tables.table_schema:
CREATE TABLE keyword_rankings (
    keyword_id UUID PRIMARY KEY,
    keyword_name VARCHAR(255) NOT NULL,
    ranking_position INT NOT NULL,
    search_engine VARCHAR(50) NOT NULL
);

CREATE TABLE KeywordRankings (
    keyword_id INT PRIMARY KEY,
    keyword_name VARCHAR(255),
    ranking_position INT,
    ranking_date TIMESTAMP
);

CREATE TABLE WebsiteMetrics (
    website_id INT PRIMARY KEY,
    website_url VARCHAR(255),
    organic_traffic INT,
    bounce_rate FLOAT
);

CREATE TABLE website_metrics (
    id SERIAL PRIMARY KEY,
    website VARCHAR(255) NOT NULL,
    total organic_traffic INT NOT NULL,
    total_backlinks INT NOT NULL
);

CREATE TABLE search_engines (
    id SERIAL PRIMARY KEY,
    search_engine_name VARCHAR(255) NOT NULL,
    supported_country VARCHAR(255) NOT NULL
);

CREATE TABLE users (
    id SERIAL PRIMARY KEY,
    username VARCHAR(255) NOT NULL,
    email VARCHAR(255) NOT NULL
);
